import { useParams } from "react-router-dom";
import { useState, useEffect } from "react";

export default function Search() {
  const [r, setR] = useState("");
  const { params } = useParams();

  console.log(params);

  useEffect(() => {

    async function fetchData() {
      const res = await fetch(
        `http://localhost:8000/api/imslp?q=${encodeURIComponent(params)}`
      );
      const data = await res.json(); // this gives an object of objects

      setR(data);
    }
    fetchData();
  }, []);

  useEffect(() => console.log(r), [r]);

  return (
    <div>
      <p className="text-sm uppercase font-thin">Search results for "{params}"</p>
    </div>
  );
}
